import React from "react";
import Header from "./component/header";
import HeaderHero from "./Hero/Header.hero";
import "./App.css";

const App = () => {
  return (
    <div>
      <Header />
      <HeaderHero />
      <div className="div_hello">
        <h1>hello</h1>
      </div>
    </div>
  );
};

export default App;
